//res.cloudinary.com/db4ji9y1x/image/upload/v1731740741/layer-602_t2eqrw.png",alt:"An to\xe0n",title:"AN TO\xc0N"}],hLe=()=>(0,zo.jsx)(lh,{style:{display:"flex",justifyContent:"center",alignItems:"center",flexDirection:"column",padding:"50px"},children:(0,zo.jsxs)("h2",{className:"text-2xl font-bold text-blue-900",children:["\u0110O G\u1eaeNG S\u1ee8C TIM M\u1ea0CH - H\xd4 H\u1ea4P (CPET)",(0,zo.jsxs)("div",{style:{display:"flex",justifyContent:"center",alignItems:"center",marginTop:"0.5rem"},children:[(0,zo.jsx)("span",{style:{width:"50px",height:"1px",backgroundColor:"#a3d1ef",margin:"0 10px"}}),(0,zo.jsx)("span",{style:{fontSize:"1.5rem",color:"#73c2ec"},children:"\u2726"}),(0,zo.jsx)("span",{style:{width:"50px",height:"1px",backgroundColor:"#a3d1ef",margin:"0 10px"}})]})]})}),pLe=()=>(0,zo.jsxs)("div",{children:[fLe(1,"\u0110O G\u1eaeNG S\u1ee8C TIM M\u1ea0CH - H\xd4 H\u1ea4P (CPET)","\n        <br />- \u0110o g\u1eafng s\u1ee9c tim m\u1ea1ch h\xf4 h\u1ea5p (CPET: Cardiopulmonary Exercise Testing) l\xe0 m\u1ed9t x\xe9t nghi\u1ec7m \u0111\xe1nh gi\xe1 \u0111\u1ed3ng th\u1eddi h\u1ec7 th\u1ed1ng tim m\u1ea1ch v\xe0 h\xf4 h\u1ea5p trong su\u1ed1t th\u1eddi gian b\u1ea1n v\u1eadn \u0111\u1ed9ng g\u1eafng s\u1ee9c.\n        <br />- \u0110o g\u1eafng s\u1ee9c tim m\u1ea1ch h\xf4 h\u1ea5p s\u1ebd gi\xfap ph\xe1t hi\u1ec7n b\u1ea1n c\xf3 b\u1ec7nh tim m\u1ea1ch hay h\xf4 h\u1ea5p n\xe0o ti\u1ec1m \u1ea9n kh\xf4ng khi m\xe0 b\u1ea1n \u0111\xe3 \u0111\u01b0\u1ee3c l\xe0m c\xe1c x\xe9t nghi\u1ec7m \u0111\xe1nh gi\xe1 ch\u1ee9c n\u0103ng h\xf4 h\u1ea5p, tim m\u1ea1ch khi ngh\u1ec9 ng\u01a1i kh\xf4ng ph\xe1t hi\u1ec7n \u0111\u01b0\u1ee3c.\n        <br />- S\u1ef1 k\u1ebft h\u1ee3p c\xe1c d\u1eef li\u1ec7u k\u1ebft qu\u1ea3 v\u1ec1 h\xf4 h\u1ea5p, tim m\u1ea1ch v\xe0 kh\xed m\xe1u \u0111\u1ed9ng m\u1ea1ch s\u1ebd gi\xfap b\xe1c s\u0129 c\u1ee7a b\u1ea1n c\xf3 nhi\u1ec1u th\xf4ng tin ch\u1ea9n \u0111o\xe1n v\xe0 ti\xean l\u01b0\u1ee3ng b\u1ec7nh cho b\u1ea1n nh\u1ea5t l\xe0 khi b\u1ea1n c\xf3 \u0111\u1ed3ng th\u1eddi c\u1ea3 b\u1ec7nh tim v\xe0 ph\u1ed5i.\n    "),fLe(2,"KHI N\xc0O B\u1ea0N C\u1ea6N \u0110O G\u1eaeNG S\u1ee8C TIM M\u1ea0CH H\xd4 H\u1ea4P?","\n        B\xe1c s\u0129 c\u1ee7a b\u1ea1n c\xf3 th\u1ec3 y\xeau c\u1ea7u b\u1ea1n th\u1ef1c hi\u1ec7n nghi\u1ec7m ph\xe1p g\u1eafng s\u1ee9c tim m\u1ea1ch h\xf4 h\u1ea5p khi:\n        <br />- C\u1ea7n \u0111\xe1nh gi\xe1 kh\u1ea3 n\u0103ng g\u1eafng s\u1ee9c c\u1ee7a b\u1ea1n.\n        <br />- C\u1ea7n t\xecm nguy\xean nh\xe2n c\u1ee7a kh\xf3 th\u1edf v\xe0 nguy\xean nh\xe2n c\u1ee7a h\u1ea1n ch\u1ebf g\u1eafng s\u1ee9c c\u1ee7a b\u1ea1n.\n        <br />- C\u1ea7n \u0111\xe1nh gi\xe1 ch\u1ee9c n\u0103ng tim m\u1ea1ch, h\xf4 h\u1ea5p tr\u01b0\u1edbc khi b\u1ea1n tr\u1ea3i qua c\xe1c ph\u1eabu thu\u1eadt l\u1edbn \u1edf v\xf9ng b\u1ee5ng hay l\u1ed3ng ng\u1ef1c.\n        <br />- B\u1ea1n \u0111ang c\xf3 b\u1ec7nh l\xfd tim m\u1ea1ch nh\u01b0: suy tim, sau ph\u1eabu thu\u1eadt tim m\u1ea1ch.\n        <br />- B\u1ea1n \u0111ang c\xf3 b\u1ec7nh l\xfd h\xf4 h\u1ea5p nh\u01b0: b\u1ec7nh ph\u1ed5i t\u1eafc ngh\u1ebdn m\u1ea1n t\xednh, b\u1ec7nh ph\u1ed5i m\xf4 k\u1ebd, b\u1ec7nh m\u1ea1ch m\xe1u ph\u1ed5i, x\u01a1 ph\u1ed5i.\n        <br />- B\u1ea1n l\xe0 v\u1eadn \u0111\u1ed9ng vi\xean hay b\u1ea1n \u0111ang tham gia ch\u01b0\u01a1ng tr\xecnh luy\u1ec7n t\u1eadp th\u1ec3 l\u1ef1c.\n        <br />- B\u1ea1n c\xf3 b\u1ec7nh l\xfd l\xe0m \u1ea3nh h\u01b0\u1edfng t\u1edbi kh\u1ea3 n\u0103ng t\u1eadp luy\u1ec7n v\xe0 c\xf3 mong mu\u1ed1n t\u1eadp luy\u1ec7n\n    "),fLe(3,"NH\u1eeeNG L\u01afU \xdd TR\u01af\u1edaC KHI TH\u1ef0C HI\u1ec6N \u0110O G\u1eaeNG S\u1ee8C TIM M\u1ea0CH - H\xd4 H\u1ea4P","\n        <br />- Kh\xf4ng \u0111\u01b0\u1ee3c \u0103n trong v\xf2ng 2-3 gi\u1edd tr\u01b0\u1edbc khi l\xe0m nghi\u1ec7m ph\xe1p.\n        <br />- Kh\xf4ng \u0111\u01b0\u1ee3c h\xfat thu\u1ed1c, u\u1ed1ng n\u01b0\u1edbc gi\u1ea3i kh\xe1t c\xf3 caffein ho\u1eb7c r\u01b0\u1ee3u trong v\xf2ng 12 gi\u1edd tr\u01b0\u1edbc khi l\xe0m nghi\u1ec7m ph\xe1p.\n        <br />- V\u1eabn c\xf3 th\u1ec3 d\xf9ng c\xe1c lo\u1ea1i thu\u1ed1c \u0111ang s\u1eed d\u1ee5ng n\u1ebfu b\xe1c s\u0129 kh\xf4ng c\xf3 h\u01b0\u1edbng d\u1eabn g\xec kh\xe1c\n        <br />- Mang gi\xe0y th\u1ec3 thao v\xe0 m\u1eb7c trang ph\u1ee5c ph\xf9 h\u1ee3p cho v\u1eadn \u0111\u1ed9ng.\n        <br />- Mang theo c\xe1c k\u1ebft qu\u1ea3 \u0111i\u1ec7n tim, si\xeau \xe2m tim, h\xf4 h\u1ea5p k\xfd \u0111\xe3 \u0111\u01b0\u1ee3c l\xe0m tr\u01b0\u1edbc \u0111\xe2y v\xe0 toa thu\u1ed1c ho\u1eb7c thu\u1ed1c b\u1ea1n \u0111ang s\u1eed d\u1ee5ng.\n    "),fLe(4,"QUY TR\xccNH TH\u1ef0C HI\u1ec6N \u0110O G\u1eaeNG S\u1ee8C TIM M\u1ea0CH - H\xd4 H\u1ea4P","\n        <br />- B\u1ea1n s\u1ebd c\u1ea7n kho\u1ea3ng 45 ph\xfat \u0111\u1ec3 th\u1ef1c hi\u1ec7n nghi\u1ec7m ph\xe1p bao g\u1ed3m c\u1ea3 th\u1eddi gian chu\u1ea9n b\u1ecb v\xe0 v\u1eadn \u0111\u1ed9ng. Th\u1eddi gian v\u1eadn \u0111\u1ed9ng th\u1ef1c s\u1ef1 ch\u1ec9 kho\u1ea3ng 12 ph\xfat. B\u1ea1n s\u1ebd \u0111i b\u1ed9 tr\xean th\u1ea3m l\u0103n hay \u0111\u1ea1p xe \u0111\u1ea1p v\u1edbi c\u01b0\u1eddng \u0111\u1ed9 v\u1eadn \u0111\u1ed9ng t\u0103ng d\u1ea7n theo th\u1eddi gian.\n\n        <br /><b><i>a. Tr\u01b0\u1edbc khi th\u1ef1c hi\u1ec7n nghi\u1ec7m ph\xe1p</i></b>\n        <br />- B\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c b\xe1c s\u0129 th\u0103m kh\xe1m nh\u01b0 nghe tim, ph\u1ed5i, ki\u1ec3m tra huy\u1ebft \xe1p xem c\xf3 b\u1ea5t th\u01b0\u1eddng g\xec c\u1ea3n tr\u1edf th\u1ef1c hi\u1ec7n nghi\u1ec7m ph\xe1p kh\xf4ng.\n        <br />- B\xe1c s\u0129 s\u1ebd xem l\u1ea1i c\xe1c k\u1ebft qu\u1ea3 \u0111i\u1ec7n tim, si\xeau \xe2m tim, h\xf4 h\u1ea5p k\xfd \u0111\xe3 \u0111\u01b0\u1ee3c l\xe0m tr\u01b0\u1edbc \u0111\xe2y c\u1ee7a b\u1ea1n v\xe0 toa thu\u1ed1c ho\u1eb7c thu\u1ed1c b\u1ea1n \u0111ang s\u1eed d\u1ee5ng\n        <br />- B\xe1c s\u0129 s\u1ebd h\u01b0\u1edbng d\u1eabn b\u1ea1n c\xe1ch v\u1eadn \u0111\u1ed9ng tr\xean xe \u0111\u1ea1p hay th\u1ea3m l\u0103n v\xe0 gi\u1ea3i th\xedch c\xe1c th\u1eafc m\u1eafc c\u1ee7a b\u1ea1n n\u1ebfu c\xf3.\n        <br />- \u0110i\u1ec1u d\u01b0\u1ee1ng s\u1ebd g\u1eafn c\xe1c \u0111i\u1ec7n c\u1ef1c d\xe1n tr\xean da v\xf9ng ng\u1ef1c c\u1ee7a b\u1ea1n \u0111\u1ec3 theo d\xf5i \u0111i\u1ec7n tim.\n        <br />- B\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c \u0111eo m\u1eb7t n\u1ea1 \u0111\u1ec3 m\xe1y c\xf3 th\u1ec3 ph\xe2n t\xedch to\xe0n b\u1ed9 kh\xed b\u1ea1n th\u1edf ra hay h\xedt v\xe0o v\xe0 \u0111\u1ec3 theo d\xf5i h\xf4 h\u1ea5p c\u1ee7a b\u1ea1n khi b\u1ea1n v\u1eadn \u0111\u1ed9ng. \u0110\u1ed3ng th\u1eddi tay b\u1ea1n c\u0169ng s\u1ebd \u0111\u01b0\u1ee3c \u0111eo b\u0103ng qu\u1ea5n huy\u1ebft \xe1p \u0111\u1ec3 theo d\xf5i huy\u1ebft \xe1p li\xean t\u1ee5c.\n\n        <br /><b><i>b. Trong khi th\u1ef1c hi\u1ec7n nghi\u1ec7m ph\xe1p</i></b>\n        <br />- B\u1ea1n s\u1ebd \u0111\u1ea1p xe \u0111\u1ea1p ho\u1eb7c ch\u1ea1y tr\xean th\u1ea3m l\u0103n v\u1edbi c\u01b0\u1eddng \u0111\u1ed9 v\u1eadn \u0111\u1ed9ng t\u0103ng d\u1ea7n. C\xe1c b\xe1c s\u0129 v\xe0 \u0111i\u1ec1u d\u01b0\u1ee1ng s\u1ebd theo d\xf5i b\u1ea1n li\xean t\u1ee5c.\n        <br />- B\u1ea1n s\u1ebd ti\u1ebfp t\u1ee5c v\u1eadn \u0111\u1ed9ng cho \u0111\u1ebfn khi c\xe1c th\xf4ng s\u1ed1 \u0111\u1ea1t ng\u01b0\u1ee1ng ho\u1eb7c khi b\u1ea1n \u0111\xe3 m\u1ec7t kh\xf4ng th\u1ec3 v\u1eadn \u0111\u1ed9ng th\xeam n\u1eefa hay b\u1ea1n c\xf3 c\xe1c tri\u1ec7u ch\u1ee9ng nh\u01b0 \u0111au ng\u1ef1c, ch\xf3ng m\u1eb7t, kh\xf3 th\u1edf, \u2026 b\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c d\u1eebng nghi\u1ec7m ph\xe1p.\n\n        <br /><b><i>c. Sau khi th\u1ef1c hi\u1ec7n nghi\u1ec7m ph\xe1p</i></b>\n        <br />- Sau khi ng\u01b0ng v\u1eadn \u0111\u1ed9ng, b\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c th\xe1o m\u1eb7t n\u1ea1 \u0111eo m\u1eb7t. B\u1ea1n s\u1ebd ng\u1ed3i y\xean tr\xean xe \u0111\u1ea1p ho\u1eb7c \u0111\u1ee9ng y\xean tr\xean th\u1ea3m l\u0103n m\u1ed9t kho\u1ea3ng th\u1eddi gian n\u1eefa cho \u0111\u1ebfn khi c\xe1c th\xf4ng s\u1ed1 huy\u1ebft \xe1p, nh\u1ecbp tim c\u1ee7a b\u1ea1n tr\u1edf l\u1ea1i b\xecnh th\u01b0\u1eddng. Sau \u0111\xf3 b\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c th\xe1o t\u1ea5t c\u1ea3 \u0111i\u1ec7n c\u1ef1c.\n    "),fLe(5,"NH\u1eeeNG NGUY C\u01a0 C\xd3 TH\u1ec2 X\xc2Y TRONG QU\xc1 TR\xccNH \u0110O G\u1eaeNG S\u1ee8C TIM M\u1ea0CH - H\xd4 H\u1ea4P?","\n        \u0110o g\u1eafng s\u1ee9c tim m\u1ea1ch, h\xf4 h\u1ea5p n\xf3i chung an to\xe0n v\xe0 hi\u1ebfm khi x\u1ea3y ra bi\u1ebfn ch\u1ee9ng. Tuy nhi\xean, trong q\xfaa tr\xecnh \u0111o c\xf3 th\u1ec3 g\xe2y ra m\u1ed9t s\u1ed1 bi\u1ebfn ch\u1ee9ng nh\u01b0: t\u1ee5t huy\u1ebft \xe1p k\xe9o d\xe0i, ho\u1eb7c nh\u1ecbp tim qu\xe1 ch\u1eadm, rung th\u1ea5t ho\u1eb7c nh\u1ecbp nhanh th\u1ea5t\u2026\n    "),fLe(6,"K\u1ebeT QU\u1ea2 TR\u1ea2 V\u1ec0 KHI \u0110O G\u1eaeNG S\u1ee8C TIM M\u1ea0CH - H\xd4 H\u1ea4P \u0110\u01af\u1ee2C PH\xc2N T\xcdCH NH\u01af TH\u1ebe N\xc0O?","\n        <br />- B\xe1c s\u0129 s\u1ebd ph\xe2n t\xedch k\u1ebft qu\u1ea3 v\xe0 gi\u1ea3i th\xedch cho b\u1ea1n ch\u1ee9c n\u0103ng tim m\u1ea1ch v\xe0 h\xf4 h\u1ea5p c\u1ee7a b\u1ea1n c\xf3 t\u1ed1t kh\xf4ng trong qu\xe1 tr\xecnh v\u1eadn \u0111\u1ed9ng.\n        <br />- N\u1ebfu k\u1ebft qu\u1ea3 b\u1ea5t th\u01b0\u1eddng b\xe1c s\u0129 s\u1ebd t\u01b0 v\u1ea5n b\u1ea1n c\u1ea7n l\xe0m g\xec ti\u1ebfp theo.\n    "),fLe(7,"T\u1ea0I SAO N\xcaN TH\u1ef0C HI\u1ec6N \u0110O G\u1eaeNG S\u1ee8C TIM M\u1ea0CH H\xd4 H\u1ea4P T\u1ea0I PH\xd2NG KH\xc1M B\u1ec6NH VI\u1ec6N","\n        <br />- \u0110\u01a1n v\u1ecb h\xf4 h\u1ea5p c\u1ee7a ph\xf2ng kh\xe1m \u0111\u01b0\u1ee3c \u0111\u1ea7u t\u01b0 nhi\u1ec1u trang thi\u1ebft b\u1ecb hi\u1ec7n \u0111\u1ea1i.\n        <br />- \u0110\u1ed9i ng\u0169 b\xe1c s\u0129 c\xf3 nhi\u1ec1u n\u0103m kinh nghi\u1ec7m c\u1ee7a tr\u01b0\u1eddng \u0110\u1ea1i h\u1ecdc Y D\u01b0\u1ee3c Tp.HCM tr\u1ef1c ti\u1ebfp th\u0103m kh\xe1m v\xe0 \u0111i\u1ec1u tr\u1ecb\n        <br />- Quy tr\xecnh \u0111\u1eb7t h\u1eb9n nhanh g\u1ecdn qua t\u1ed5ng \u0111\xe0i 1900 6923.\n    ")]}),fLe=(e,t,n)=>(0,zo.jsxs)(fh,{className:"py-4",children:[(0,zo.jsx)(lh,{children:(0,zo.jsxs)("h5",{className:"text-xl font-bold text-blue-900",children:[e,". ",t]})}),(0,zo.jsx)(lh,{children:(0,zo.jsx)("p",{className:"text-justify text-lg",dangerouslySetInnerHTML:{__html:n}})})]},e),gLe=()=>{const e=(0,c.useRef)(null);return(0,zo.jsxs)("div",{className:"news-section py-8 text-center",children:[(0,zo.jsx)("h2",{className:"text-blue-700 font-bold text-2xl mb-4",children:"GI\xc1 TR\u1eca C\u1ed0T L\xd5I"}),(0,zo.jsxs)("div",{style:{display:"flex",justifyContent:"center",alignItems:"center",marginTop:"0.5rem"},children:[(0,zo.jsx)("span",{style:{width:"50px",height:"1px",backgroundColor:"#a3d1ef",margin:"0 10px"}}),(0,zo.jsx)("span",{style:{fontSize:"1.5rem",color:"#73c2ec"},children:"\u2726"}),(0,zo.jsx)("span",{style:{width:"50px",height:"1px",backgroundColor:"#a3d1ef",margin:"0 10px"}})]}),(0,zo.jsxs)("div",{style:{position:"relative"},children:[(0,zo.jsx)(FRe,{ref:e,dots:!1,children:dLe.map(((e,t)=>(0,zo.jsx)("div",{children:(0,zo.jsxs)(fh,{xs:24,className:"text-center",children:[(0,zo.jsx)("div",{className:"mx-auto mb-4 flex items-center justify-center",style:{width:"100px",height:"100px",borderRadius:"50%",backgroundColor:"#3e73d4",boxShadow:"0 4px 10px rgba(0, 0, 0, 0.2)"},children:(0,zo.jsx)("img",{style:{width:"50px",height:"50px",objectFit:"cover"},src:e.src,alt:e.alt,className:"icon-image"})}),(0,zo.jsx)("h3",{className:"text-blue-700 font-bold text-lg",children:e.title})]})},t)))}),(0,zo.jsx)(Kj,{type:"text",icon:(0,zo.jsx)(tl,{}),onClick:()=>e.current.prev(),style:{position:"absolute",top:"50%",left:"250px",transform:"translateY(-50%)"}}),(0,zo.jsx)(Kj,{type:"text",icon:(0,zo.jsx)(il,{}),onClick:()=>e.current.next(),style:{position:"absolute",top:"50%",right:"250px",transform:"translateY(-50%)"}})]})]})},mLe=()=>(0,zo.jsxs)("div",{children:[(0,zo.jsx)(HC,{}),(0,zo.jsx)(hLe,{}),(0,zo.jsx)(pLe,{}),(0,zo.jsx)(gLe,{}),(0,zo.jsx)(zO,{})]}),yLe=[{src:"https://res.cloudinary.com/db4ji9y1x/image/upload/v1731740676/vector-smart-object-1_dlrqa1.png",alt:"Ti\xean phong",title:"TI\xcaN PHONG"},{src:"https://res.cloudinary.com/db4ji9y1x/image/upload/v1731740700/layer-600juykyfu_gybtcl.png",alt:"Th\u1ea5u hi\u1ec3u",title:"TH\u1ea4U HI\u1ec2U"},{src:"https://res.cloudinary.com/db4ji9y1x/image/upload/v1731740719/layer-601_sb3r6p.png",alt:"Chu\u1ea9n m\u1ef1c",title:"CHU\u1ea8N M\u1ef0C"},{src:"https://res.cloudinary.com/db4ji9y1x/image/upload/v1731740741/layer-602_t2eqrw.png",alt:"An to\xe0n",title:"AN TO\xc0N"}],vLe=()=>(0,zo.jsx)(lh,{style:{display:"flex",justifyContent:"center",alignItems:"center",flexDirection:"column",padding:"50px"},children:(0,zo.jsxs)("h2",{className:"text-2xl font-bold text-blue-900",children:["\u0110O G\u1eaeNG S\u1ee8C TIM M\u1ea0CH - H\xd4 H\u1ea4P (PSG)",(0,zo.jsxs)("div",{style:{display:"flex",justifyContent:"center",alignItems:"center",marginTop:"0.5rem"},children:[(0,zo.jsx)("span",{style:{width:"50px",height:"1px",backgroundColor:"#a3d1ef",margin:"0 10px"}}),(0,zo.jsx)("span",{style:{fontSize:"1.5rem",color:"#73c2ec"},children:"\u2726"}),(0,zo.jsx)("span",{style:{width:"50px",height:"1px",backgroundColor:"#a3d1ef",margin:"0 10px"}})]})]})}),bLe=()=>(0,zo.jsxs)("div",{children:[xLe(1,"\u0110O \u0110A K\xdd GI\u1ea4C NG\u1ee6 (Polysomnography - PSG)","\n        \u0110o \u0111a k\xfd gi\u1ea5c ng\u1ee7 l\xe0 m\u1ed9t thu\u1eadt ng\u1eef y khoa ch\u1ec9 m\u1ed9t ph\u01b0\u01a1ng ph\xe1p \u0111o \u0111\u1ea1c c\xe1c ho\u1ea1t \u0111\u1ed9ng c\u1ee7a c\u01a1 th\u1ec3 khi ng\u1ee7. C\xe1c ho\u1ea1t \u0111\u1ed9ng n\xe0y \u0111\u01b0\u1ee3c ghi nh\u1eadn b\u1eb1ng c\xe1c \u0111i\u1ec7n c\u1ef1c v\xe0 t\xedn hi\u1ec7u s\u1ebd truy\u1ec1n \u0111\u1ebfn m\xe1y t\xednh, sau \u0111\xf3, b\xe1c s\u0129 s\u1ebd \u0111\u1ecdc \u0111a k\xfd gi\u1ea5c ng\u1ee7 v\xe0 th\xf4ng b\xe1o cho b\u1ea1n bi\u1ebft k\u1ebft qu\u1ea3.\n    "),xLe(2,"C\xe1c ho\u1ea1t \u0111\u1ed9ng \u0111\u01b0\u1ee3c ghi nh\u1eadn b\u1eb1ng m\xe1y \u0111o \u0111a k\xfd gi\u1ea5c ng\u1ee7:","\n        <br />- \u0110i\u1ec7n n\xe3o (\u0111i\u1ec7n c\u1ef1c \u0111\u1eb7t tr\xean da \u0111\u1ea7u)\n        <br />- Chuy\u1ec3n \u0111\u1ed9ng m\u1eaft (\u0111i\u1ec7n c\u1ef1c \u0111\u01b0\u1ee3c \u0111\u1eb7t g\u1ea7n m\u1eaft)\n        <br />- Tr\u01b0\u01a1ng l\u1ef1c c\u01a1 n\u0103m (\u0111i\u1ec7n l\u1ef1c \u0111\u1eb7t g\u1ea7n c\u1eb1m)\n        <br />- Nh\u1ecbp tim (\u0111i\u1ec7n c\u1ef1c \u0111\u1eb7t tr\xean ng\u1ef1c)\n        <br />- Chuy\u1ec3n \u0111\u1ed9ng ch\xe2n (\u0111i\u1ec7n c\u1ef1c \u0111\u01b0\u1ee3c \u0111\u1eb7t tr\xean ch\xe2n)\n        <br />- Lu\u1ed3ng kh\xed th\u1edf (b\u1ed9 c\u1ea3m bi\u1ebfn \u0111\u01b0\u1ee3c \u0111\u1eb7t g\u1ea7n m\u0169i v\xe0 mi\u1ec7ng)\n        <br />- C\u1eed \u0111\u1ed9ng th\u1edf (hai v\xe0nh \u0111ai \u0111\xe0n h\u1ed3i \u0111\u1eb7t xung quanh ng\u1ef1c v\xe0 b\u1ee5ng)\n        <br />- \u0110\u1ed9 b\xe3o h\xf2a oxy (c\u1ea3m bi\u1ebfn nh\u1ecf g\u1eafn v\xe0o ng\xf3n tay ho\u1eb7c d\xe1i tai)\n        <br />- Ghi \xe2m thanh v\xe0 quay video k\u1ef9 thu\u1eadt s\u1ed1\n    "),xLe(3,"\u0110o \u0110a k\xfd gi\u1ea5c ng\u1ee7 ch\u1ea9n \u0111o\xe1n v\xe0 x\xe1c \u0111\u1ecbnh c\xe1c r\u1ed1i lo\u1ea1n gi\u1ea5c ng\u1ee7 nh\u01b0:","\n        <br />- Ng\u01b0ng th\u1edf l\xfac ng\u1ee7 t\u1eafc ngh\u1ebdn\n        <br />- Ng\u01b0ng th\u1edf l\xfac ng\u1ee7 trung \u01b0\u01a1ng\n        <br />- Ng\u1ee7 r\u0169\n        <br />- M\u1ea5t ng\u1ee7\n        <br />- H\u1ed9i ch\u1ee9ng ch\xe2n kh\xf4ng y\xean\n        <br />- Chuy\u1ec3n \u0111\u1ed9ng chi c\xf3 chu k\xec\n        <br />- C\xe1c r\u1ed1i lo\u1ea1n li\xean quan gi\u1ea5c ng\u1ee7\n    "),xLe(4,"T\u1ea1i sao l\u1ea1i c\u1ea7n thi\u1ebft \u0111\u1ec3 \u0111o c\xe1c ho\u1ea1t \u0111\u1ed9ng c\u01a1 th\u1ec3 khi ng\u1ee7?","\n        <br />- Trong khi b\u1ea1n ng\u1ee7, c\xe1c ho\u1ea1t \u0111\u1ed9ng c\u1ee7a c\u01a1 th\u1ec3 kh\xe1c khi b\u1ea1n th\u1ee9c. R\u1ed1i lo\u1ea1n gi\u1ea5c ng\u1ee7 nh\u01b0 ng\xe1y v\xe0 ng\u01b0ng th\u1edf l\xfac ng\u1ee7, m\u1ea5t ng\u1ee7 c\xf3 th\u1ec3 \u1ea3nh h\u01b0\u1edfng ho\u1ea1t \u0111\u1ed9ng ban ng\xe0y, g\xe2y bu\u1ed3n ng\u1ee7 qu\xe1 m\u1ee9c v\xe0o ban ng\xe0y v\xe0 c\xf3 th\u1ec3 d\u1eabn \u0111\u1ebfn v\u1ea5n \u0111\u1ec1 s\u1ee9c kh\u1ecfe nghi\xeam tr\u1ecdng. V\xec ph\u1ea3i theo d\xf5i c\xe1c ho\u1ea1t \u0111\u1ed9ng khi ng\u1ee7 n\xean khi \u0111o \u0111a k\xfd gi\u1ea5c ng\u1ee7, b\u1ea1n s\u1ebd ng\u1ee7 qua \u0111\xeam t\u1ea1i Ph\xf2ng kh\xe1m B\u1ec7nh vi\u1ec7n .\n        <br />- Qua vi\u1ec7c \u0111o c\xe1c ho\u1ea1t \u0111\u1ed9ng c\u1ee7a c\u01a1 th\u1ec3 khi ng\u1ee7, b\xe1c s\u0129 s\u1ebd nh\u1eadn bi\u1ebft \u0111\u01b0\u1ee3c b\u1ea1n \u0111ang m\u1eafc d\u1ea1ng r\u1ed1i lo\u1ea1n gi\u1ea5c ng\u1ee7 n\xe0o, t\u1eeb \u0111\xf3 c\xf3 k\u1ebf ho\u1ea1ch \u0111i\u1ec1u tr\u1ecb ph\xf9 h\u1ee3p cho b\u1ea1n.\n    "),xLe(5,"C\xe1c c\xe2u h\u1ecfi th\u01b0\u1eddng g\u1eb7p khi th\u1ef1c hi\u1ec7n \u0111o \u0111a k\xfd gi\u1ea5c ng\u1ee7","\n        <br /><b><i>a. N\u1ebfu t\xf4i \u0111o \u0111a k\xfd gi\u1ea5c ng\u1ee7, c\xe1c \u0111i\u1ec7n c\u1ef1c c\xf3 \u1ea3nh h\u01b0\u1edfng g\xec \u0111\u1ebfn t\xf4i kh\xf4ng?</i></b>\n        <br />- C\xe2u tr\u1ea3 l\u1eddi l\xe0: Kh\xf4ng. \u0110a k\xfd gi\u1ea5c ng\u1ee7 l\xe0 m\u1ed9t ph\u01b0\u01a1ng ph\xe1p ki\u1ec3m tra kh\xf4ng x\xe2m l\u1ea5n, kh\xf4ng g\xe2y \u0111au \u0111\u1edbn. C\xe1c \u0111i\u1ec7n c\u1ef1c \u0111\u01b0\u1ee3c d\xe1n v\xe0o da \u0111\u1ea7u b\u1ea1n v\xe0 kh\xf4ng g\xe2y \u0111au hay gi\u1ef1t \u0111i\u1ec7n. Sau khi \u0111o \u0111a k\xfd gi\u1ea5c ng\u1ee7 xong, c\xe1c \u0111i\u1ec7n c\u1ef1c c\xf3 th\u1ec3 \u0111\u01b0\u1ee3c l\u1ea5y ra m\u1ed9t c\xe1ch nh\u1eb9 nh\xe0ng.\n\n        <br /><b><i>b. C\xe1c \u0111i\u1ec7n c\u1ef1c \u0111o \u0111a k\xfd gi\u1ea5c ng\u1ee7 c\xf3 c\u1ea3n tr\u1edf t\xf4i ng\u1ee7 kh\xf4ng?</i></b>\n        <br />- Thi\u1ebft b\u1ecb \u0111\u01b0\u1ee3c thi\u1ebft k\u1ebf \u0111\u1ec3 \u0111o c\xe1c ho\u1ea1t \u0111\u1ed9ng c\u01a1 th\u1ec3 khi ng\u1ee7 n\xean n\xf3 s\u1ebd gi\xfap b\u1ea1n th\u01b0 gi\xe3n v\xe0 s\u1eb5n s\xe0ng cho gi\u1ea5c ng\u1ee7. Ph\xf2ng \u0111o \u0111a k\xfd gi\u1ea5c ng\u1ee7 c\u1ee7a Ph\xf2ng kh\xe1m B\u1ec7nh vi\u1ec7n  \u0111\u01b0\u1ee3c thi\u1ebft k\u1ebf gi\xfap b\u1ea1n c\u1ea3m th\u1ea5y th\xe2n thi\u1ec7n, d\u1ec5 d\xe0ng ng\u1ee7 h\u01a1n. Trong ph\xf2ng c\u0169ng c\xf3 \u0111\u1ea7y \u0111\u1ee7 c\xe1c ti\u1ec7n \xedch nh\u01b0 m\xe1y \u0111i\u1ec1u h\xf2a, tivi\u2026 nh\u1eb1m gi\xfap b\u1ea1n c\u1ea3m th\u1ea5y nh\u01b0 \u1edf nh\xe0\u2026\n\n        <br /><b><i>c. Sau khi m\u1eafc c\xe1c \u0111i\u1ec7n c\u1ef1c, li\u1ec7u t\xf4i c\xf3 th\u1ec3 di chuy\u1ec3n, ch\u1eb3ng h\u1ea1n nh\u01b0 \u0111i v\u1ec7 sinh?</i></b>\n        <br />- C\xe1c \u0111i\u1ec7n c\u1ef1c v\xe0 d\xe2y \u0111eo kh\xf4ng c\u1ea3n tr\u1edf b\u1ea1n \u0111i l\u1ea1i nh\u01b0ng b\u1ea1n n\xean h\u1ea1n ch\u1ebf di chuy\u1ec3n. B\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c mang 1 b\u1ed9 ph\xe1t t\xedn hi\u1ec7u, c\xe1c t\xedn hi\u1ec7u thu \u0111\u01b0\u1ee3c s\u1ebd \u0111\u01b0\u1ee3c b\u1ed9 ph\xe1t t\xedn hi\u1ec7u n\xe0y truy\u1ec1n \u0111\u1ebfn m\xe1y t\xednh. N\u1ebfu b\u1ea1n mu\u1ed1n \u0111i v\u1ec7 sinh th\xec \u0111i\u1ec1u d\u01b0\u1ee1ng tr\u1ef1c s\u1ebd g\u1ee1 d\xe2y n\u1ed1i gi\u1eefa b\u1ed9 truy\u1ec1n t\xedn hi\u1ec7u v\xe0 m\xe1y t\xednh \u0111\u1ec3 b\u1ea1n c\xf3 th\u1ec3 di chuy\u1ec3n.\n    "),xLe(6,"Nh\u1eefng l\u01b0u \xfd tr\u01b0\u1edbc khi \u0111o \u0111a k\xfd gi\u1ea5c ng\u1ee7?","\n        <br />- Ho\xe0n th\xe0nh b\u1ea3ng c\xe2u h\u1ecfi, mang toa thu\u1ed1c, c\xe1c ch\u1ec9 \u0111\u1ecbnh v\xe0 h\u01b0\u1edbng d\u1eabn c\u1ee7a B\xe1c s\u0129. B\u1ea1n c\xf3 th\u1ec3 mang g\u1ed1i v\xe0 m\u1ec1n c\u1ee7a m\xecnh theo n\u1ebfu mu\u1ed1n c\xf3 c\u1ea3m gi\xe1c nh\u01b0 \u1edf nh\xe0\n        <br />- M\u1eb7c trang ph\u1ee5c tho\u1ea3i m\xe1i \u0111\u1ec3 d\u1ec5 ng\u1ee7 h\u01a1n;\n        <br />- Mang theo d\u1ee5ng c\u1ee5 v\u1ec7 sinh c\xe1 nh\xe2n v\xe0 qu\u1ea7n \xe1o \u0111\u1ec3 thay v\xe0o s\xe1ng h\xf4m sau;\n        <br />- Mang theo s\xe1ch n\u1ebfu b\u1ea1n mu\u1ed1n \u0111\u1ecdc tr\u01b0\u1edbc khi ng\u1ee7\n        <br />- N\u1ebfu b\u1ea1n c\u1ea7n 01 b\u1eefa \u0103n nh\u1eb9 tr\u01b0\u1edbc khi ng\u1ee7 h\xe3y b\xe1o v\u1edbi nh\xe2n vi\xean Ph\xf2ng kh\xe1m tr\u01b0\u1edbc v\xe0 mang theo. \n    "),xLe(7,"Nh\u1eefng \u0111\u1ed1i t\u01b0\u1ee3ng n\xean th\u1ef1c hi\u1ec7n \u0110o \u0111a k\xfd gi\u1ea5c ng\u1ee7.","\n        <br />- Ng\u01b0\u1eddi b\u1ecb b\xe9o ph\xec, ng\u1ee7 ng\xe1y, m\u1ea5t ng\u1ee7 kh\xf4ng r\xf5 nguy\xean nh\xe2n.\n        <br />- Ng\u01b0\u1eddi s\u1eed d\u1ee5ng bia r\u01b0\u1ee3u nhi\u1ec1u, m\u1eafc b\u1ec7nh l\xfd Tai - m\u0169i - h\u1ecdng k\xe9o d\xe0i, t\xe1i ph\xe1t nhi\u1ec1u l\u1ea7n, c\u1ea5u tr\xfac v\xf9ng m\u0169i, xoang c\xf3 nh\u1eefng b\u1ea5t th\u01b0\u1eddng (c\u1eb1m l\u1eb9m, v\u1eb9o v\xe1ch ng\u0103n m\u0169i,\u2026)\n        <br />- Ng\u01b0\u1eddi m\u1eafc c\xe1c b\u1ec7nh l\xfd t\u0103ng huy\u1ebft \xe1p, suy tim, \u0111\xe1i th\xe1o \u0111\u01b0\u1eddng,\u2026 nh\u01b0ng b\u1ec7nh kh\xf3 ki\u1ec3m so\xe1t.\n    "),xLe(8,"T\u1ea1i sao n\xean \u0110o \u0111a k\xfd t\u1ea1i Ph\xf2ng kh\xe1m B\u1ec7nh vi\u1ec7n","\n        <br />- \u0110\u01a1n v\u1ecb h\xf4 h\u1ea5p \u0111\u01b0\u1ee3c \u0111i\u1ec1u h\xe0nh tr\u1ef1c ti\u1ebfp b\u1edfi PGS.TS.BS L\xea Th\u1ecb Tuy\u1ebft Lan c\xf9ng c\xe1c b\xe1c s\u0129, gi\u1ea3ng vi\xean \u0110\u1ea1i h\u1ecdc Y D\u01b0\u1ee3c TP.HCM, c\xf3 nhi\u1ec1u kinh nghi\u1ec7m v\xe0 \u0111\u01b0\u1ee3c \u0111\xe0o t\u1ea1o chuy\xean s\xe2u trong \u0111i\u1ec1u tr\u1ecb c\xe1c b\u1ec7nh l\xfd v\u1ec1 h\xf4 h\u1ea5p - gi\u1ea5c ng\u1ee7;- H\u1ec7 th\u1ed1ng m\xe1y m\xf3c \u0111\u01b0\u1ee3c trang b\u1ecb hi\u1ec7n \u0111\u1ea1i gi\xfap B\xe1c s\u0129 ch\u1ea9n \u0111o\xe1n ch\xednh x\xe1c v\xe0 \u0111i\u1ec1u tr\u1ecb hi\u1ec7u qu\u1ea3;\n        <br />- Ph\xf2ng kh\xe1m c\xf3 trang b\u1ecb mi\u1ec5n ph\xed gi\u01b0\u1eddng ph\u1ee5 cho ng\u01b0\u1eddi th\xe2n;\n        <br />- \u0110\u1ed9i ng\u0169 k\u1ef9 thu\u1eadt vi\xean c\xf3 chuy\xean m\xf4n cao, t\u1eadn t\xecnh, vui v\u1ebb, chu \u0111\xe1o.\n    ")]}),xLe=(e,t,n)=>(0,zo.jsxs)(fh,{className:"py-4",children:[(0,zo.jsx)(lh,{children:(0,zo.jsxs)("h5",{className:"text-xl font-bold text-blue-900",children:[e,". ",t]})}),(0,zo.jsx)(lh,{children:(0,zo.jsx)("p",{className:"text-justify text-lg",dangerouslySetInnerHTML:{__html:n}})})]},e),wLe=()=>{const e=(0,c.useRef)(null);return(0,zo.jsxs)("div",{className:"news-section py-8 text-center",children:[(0,zo.jsx)("h2",{className:"text-blue-700 font-bold text-2xl mb-4",children:"GI\xc1 TR\u1eca C\u1ed0T L\xd5I"}),(0,zo.jsxs)("div",{style:{display:"flex",justifyContent:"center",alignItems:"center",marginTop:"0.5rem"},children:[(0,zo.jsx)("span",{style:{width:"50px",height:"1px",backgroundColor:"#a3d1ef",margin:"0 10px"}}),(0,zo.jsx)("span",{style:{fontSize:"1.5rem",color:"#73c2ec"},children:"\u2726"}),(0,zo.jsx)("span",{style:{width:"50px",height:"1px",backgroundColor:"#a3d1ef",margin:"0 10px"}})]}),(0,zo.jsxs)("div",{style:{position:"relative"},children:[(0,zo.jsx)(FRe,{ref:e,dots:!1,children:yLe.map(((e,t)=>(0,zo.jsx)("div",{children:(0,zo.jsxs)(fh,{xs:24,className:"text-center",children:[(0,zo.jsx)("div",{className:"mx-auto mb-4 flex items-center justify-center",style:{width:"100px",height:"100px",borderRadius:"50%",backgroundColor:"#3e73d4",boxShadow:"0 4px 10px rgba(0, 0, 0, 0.2)"},children:(0,zo.jsx)("img",{style:{width:"50px",height:"50px",objectFit:"cover"},src:e.src,alt:e.alt,className:"icon-image"})}),(0,zo.jsx)("h3",{className:"text-blue-700 font-bold text-lg",children:e.title})]})},t)))}),(0,zo.jsx)(Kj,{type:"text",icon:(0,zo.jsx)(tl,{}),onClick:()=>e.current.prev(),style:{position:"absolute",top:"50%",left:"250px",transform:"translateY(-50%)"}}),(0,zo.jsx)(Kj,{type: